import React from 'react';

import './App.css';
import { choosenLayout } from './component/choosenLayout';

const App = () => {
  return (
    <div className="App-container">
      <div className="vmc-header">
        <h1>HVC</h1>
      </div>
      <div className="vmc-layout-container">
        <choosenLayout></choosenLayout>      
        </div>
    </div>
  );
}

export default App;
